  return (
    <Container>
      <Col md={4}>
        <Image width={300} height={300} src={clothe.img}/>
      </Col>
      <Col md={4}>
        
      </Col>
      <Col md={4}>
        
      </Col>
    </Container>
  )
};

export default DressPage;
